import Topbar from './Topbar/Topbar';
import './TournamentPage.css'
import PBatStats from "../../components/Player/PBatStats/PBatStats";


function PlayerPage() {
    let { t_id } = useParams();
    let { page } = useParams();
    let component = <Pointstable t_id={t_id}/>
    switch(page) {
        case "bat_stats":
            component = <PBatStats t_id={t_id}/>
            break;
        // case "bat_stats":
        //     component = <BatStats t_id={t_id}/>
        //     break;
        // case "ball_stats":
        //     component = <BallStats t_id={t_id}/>
        //     break;
        // case "stats":
        //     component = <Stats t_id={t_id}/>
        //     break;

        default:
            component = <PBatStats t_id={t_id}/>
    }
    return (
        <div id="player_page">
            <div id="player_page_item1">
                <Topbar page={page} t_id={t_id}/>
            </div>
            <div id="player_page_item2">
                <div>
                    {component}
                </div>
            </div>

        </div>
    )

}
export default PlayerPage;
